sys_variable_value.value:
(function execute(inputs, outputs) {

  outputs.repositories = [];

  try {
    outputs.repositories = JSON.parse(inputs.response_body).map(repo => ({
      id: repo.id,
      name: repo.name,
      owner: {
        id: repo.owner.id,
        login: repo.owner.login
      },
      default_branch: repo.default_branch,
      ssh_url: repo.ssh_url,
      private: repo.private
    }));
  } catch (e) {

  }

  if (outputs.repositories.length == 0) {
    outputs.repositories = null;
  }

})(inputs, outputs);

